{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/quynhn1/r-project?scriptVersionId=95997178\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","metadata":{"_cell_guid":"9b230c27-ba5b-45a8-8f26-db2955642650","_uuid":"847638d7b6aaeaa56c7032d212ad9fb98f6dc4c6","execution":{"iopub.execute_input":"2022-05-13T00:09:40.674272Z","iopub.status.busy":"2022-05-13T00:09:40.673213Z","iopub.status.idle":"2022-05-13T00:09:40.684866Z"}},"source":["# A visual exploration of the size and GC content of sequenced genomes avaliable on [NCBI](https://www.ncbi.nlm.nih.gov/)\n","\n","   #Genome size is commonly reported in megabase pairs (megabase = 1,000,000 base pairs of DNA). The size of genomes is extremly variable across species and influenced by a large number of factors (if you're curious the human genome is ~3,000 Mb (megabase pairs), or 3 billion base pairs in size). The NCBI sequenced genome dataset includes genomes from three domains of organisms: eukaryotes (multi cellular organisms, like you, ducks and ferms), porkaryote (single cell, bacteria) and virus genomes (not a Linnean doman... [more a weird grey area](https://www.scientificamerican.com/article/are-viruses-alive-2004/). Here I plot the size of the genomes in these three domains to compare them, and also look at the GC content of the genomes across these domains. %GC content is the percentage of DNA base pairs composed of G and C (guanine and cytosine) GC-content is indicative of many protein coding genes, and the %GC content is indicative of a gene-rich genome. GC ratios within a genome are know to be extremly variable, with low %GC indicating a large amount of non-coding DNA in the genome. \n","\n","#These data are derived from [NCBI's repository of sequenced genomes](https://www.ncbi.nlm.nih.gov/home/genomes/). Through the links provided in the Kaggle dataset, one can access the entire sequence to any of these genomes as they are pubically avaliable (for free! thanks science!)"]},{"cell_type":"code","execution_count":1,"metadata":{},"outputs":[],"source":[]},{"cell_type":"markdown","metadata":{"_cell_guid":"1e8cee89-39c1-450c-8ad4-3f33c755322d","_uuid":"35cfd25bf3e26110296bba7f636efca0e6e49e57"},"source":["## Loading the data, assessment and cleanup\n"]},{"cell_type":"code","execution_count":2,"metadata":{"_cell_guid":"73dd573b-e12a-421e-aaf4-ed8b3398d4a8","_execution_state":"idle","_uuid":"fee0228231cf3d013915cfa42f302d6514f51e69","execution":{"iopub.execute_input":"2022-05-19T04:34:15.583093Z","iopub.status.busy":"2022-05-19T04:34:15.579926Z","iopub.status.idle":"2022-05-19T04:34:15.601517Z"}},"outputs":[{"name":"stderr","output_type":"stream","text":["── Attaching packages ─────────────────────────────────────── tidyverse 1.2.1 ──\n","✔ ggplot2 2.2.1.9000     ✔ purrr   0.2.4     \n","✔ tibble  1.4.2          ✔ dplyr   0.7.4     \n","✔ tidyr   0.8.0          ✔ stringr 1.2.0     \n","✔ readr   1.2.0          ✔ forcats 0.2.0     \n","── Conflicts ────────────────────────────────────────── tidyverse_conflicts() ──\n","✖ dplyr::filter() masks stats::filter()\n","✖ dplyr::lag()    masks stats::lag()\n"]}],"source":["library('tidyverse')\n","library('ggthemes')"]},{"cell_type":"code","execution_count":3,"metadata":{"_cell_guid":"d781bafa-b848-46b0-9c6f-8af10db645a0","_uuid":"a6bfd45fe6fb882ad26c564245d4f4a7c1a2a788","execution":{"iopub.execute_input":"2022-05-19T04:34:15.608557Z","iopub.status.busy":"2022-05-19T04:34:15.605782Z","iopub.status.idle":"2022-05-19T04:34:15.751839Z"},"scrolled":true},"outputs":[{"name":"stderr","output_type":"stream","text":["Parsed with column specification:\n","cols(\n","  `#Organism Name` = col_character(),\n","  `Organism Groups` = col_character(),\n","  Strain = col_character(),\n","  BioSample = col_character(),\n","  BioProject = col_character(),\n",